function Dril(){

    const a="in "
    const b="GTYDE TECHNOLOGIES"
    return(
        
            <div>
                <h2>1.We are learning props drilling method {a} {b} </h2>
                <BLUE data={a} get={b}/>
            </div>
         
    )        
    
}
function BLUE(props){
    const {data,get}=props
    return(

        <div>
        <h2> 2.We are learning props drilling method  {data} {get}</h2>
        <GREEN  at={data} et={get}/>
    </div>

    )
}

function GREEN(props){
   
    const {at,et}=props
     return(
        <div>
        <h2> 3.We are learning props drilling method {at} {et} </h2>
        <PINK  da={at} ge={et}/>
    </div>

    )
}

function PINK(props){
    const {da,ge}=props
    return(
        <div>
        <h2>4.We are learning props drilling method {da} {ge} </h2>
        <ORANGE  ta={da} t={ge}/>
    </div>

    )
}


function ORANGE( props){
    const {ta,t}=props
    return(
        <div>
        <h2>5.We are learning props drilling method {ta} {t} </h2>
        <YELLOW  ata={ta} het={t} />
    </div>

    )
}


function YELLOW(props){
    const {ata,het}=props
    return(
        <div>
        <h2>6.We are learning props drilling method  {ata} {het}</h2>
        <BROWN>  tata={ata} tget={het}</BROWN>
    </div>

    )
}


function BROWN( props){
    const { tata,tget}=props
    return(
        <div>
        <h2>7.We are learning props drilling method { tata} {tget} </h2>
    </div>

    )
}

export default Dril;
